public void init()
{
    callerControl = SysTableLookup::getCallerStringControl(element.args());

    super();

    if (element.args().caller() && element.args().dataset())
    {
        FieldId id = fieldName2id(element.args().dataset(),fieldStr(InventTable, ItemId));

        if (id)
        {
            itemId = element.args().record().(id);
        }

        if (element.args().dataset() == tableNum(ReqPO))
        {
            FieldId covInventDimIdFieldId = fieldName2id(element.args().dataset(), fieldStr(ReqPO,CovInventDimId));
            this.setInventDim(InventDim::find(element.args().record().(covInventDimIdFieldId)));
        }
    }

    element.updateDesign(InventDimFormDesignUpdate::Init);
}

