void run()
{
    this.setSelectMode();

    var resolver = VendorDataInteractorFactory::useExistingOrCreateResolver(callerControl);

    filterLookup = SysTableLookup::filterLookupPreRun_AllDS(callerControl,
                                                            selectedControl,
                                                            selectedFormDataSource);
    super();

    if (filterLookup)
    {
        selectedFormDataSource.research();
    }

    SysTableLookup::filterLookupPostRunEx(filterLookup,
                                          callerControl.text(),
                                          selectedControl,
                                          selectedFormDataSource,
                                          resolver, DirPartyTable_Name, true);
}

