void setSelectMode()
{
    void setSelectedControlAndDataSource(FormStringControl  _selectedControl,
                                         FormDataSource     _selectedFormDataSource)
    {
        selectedControl         = _selectedControl;
        selectedFormDataSource  = _selectedFormDataSource;
        this.selectMode(_selectedControl);
        _selectedControl.setFocus();
    }

    if (priceDiscTab.isActivePage())
    {
        setSelectedControlAndDataSource(priceDiscTable_AccountRelation, priceDiscTable_ds);
        return;
    }

    if (custVendExtTab.isActivePage())
    {
        setSelectedControlAndDataSource(custVendExternalItem_CustVendRelation, custVendExternalItem_ds);
        return;
    }

    if (approvedVendTab.isActivePage())
    {
        setSelectedControlAndDataSource(pdsApprovedVendorList_PdsApprovedVendor, pdsApprovedVendorList_ds);
        return;
    }

    if (vendTableTab.isActivePage())
    {
        setSelectedControlAndDataSource(vendTable_AccountNum, vendTable_ds);
    }
}

public boolean unpack(container _packedClass)
{
    Integer version = conPeek(_packedClass, 1);
    Integer tab;

    switch (version)
    {
        case CurrentVersion  :
            [version, #CurrentList, tab] = _packedClass;
            break;
        default :
            return false;
    }

    ctrlTab.tab(tab);

    return true;
}

void updateDesign(InventDimFormDesignUpdate mode)
{
    Set                 validPriceDisc, validExternalItem;
    InventDimGroupSetup inventDimGroupSetup;

    switch (mode)
    {
        case InventDimFormDesignUpdate::Init:
        case InventDimFormDesignUpdate::LinkActive:
            validPriceDisc      = new Set(Types::String);
            validExternalItem   = new Set(Types::String);

            validPriceDisc.add(priceDiscInventDim_ds.name());
            validExternalItem.add(externalItemInventDim_ds.name());

            if (!inventDimFormSetupPriceDisc)
            {
                inventDimFormSetupPriceDisc = InventDimCtrl::newFromFormValidDataSources(element, validPriceDisc);
            }

            inventDimGroupSetup = InventDimGroupSetup::newItemId(itemId);
            inventDimGroupSetup.inventDimParmActiveSalesPriceProductDim(inventDimParmSalesPriceItemDim);
            inventDimFormSetupPriceDisc.parmDimParmVisibleGrid(inventDimParmSalesPriceItemDim);

            if (!inventDimFormSetupExternalItem)
            {
                inventDimFormSetupExternalItem = InventDimCtrl::newFromFormValidDataSources(element, validExternalItem);
            }

            inventDimGroupSetup.inventDimParmActiveProductDimension(inventDimParmExternalItemDim);
            inventDimFormSetupExternalItem.parmDimParmVisibleGrid(inventDimParmExternalItemDim);

        case InventDimFormDesignUpdate::Active:
            inventDimFormSetupPriceDisc.formActiveSetup();
            inventDimFormSetupPriceDisc.formSetControls(true);

            inventDimFormSetupExternalItem.formActiveSetup();
            inventDimFormSetupExternalItem.formSetControls(true);
            break;

        default:
            throw error(strFmt("@SYS54195", funcName()));
    }
}

public void closeSelectRecord(Common _selectedRecord)
{
    SegmentedEntryControl sec = SysTableLookup::getCallerControl(element.args()) as SegmentedEntryControl;
    if (sec == null)
    {
        super(_selectedRecord);
    }
    else
    {
        VendTable vendTableArg = _selectedRecord as VendTable;

        sec.updateCustomLookupNaturalKey(vendTableArg.AccountNum);
        this.close();
    }
}

void init()
{
    super();

    this.query().dataSourceName(VendTable_DS.name()).clearDynalinks();
}

void executeQuery()
{
    InventDimParm           inventDimParmGroupBy;
    QueryBuildDataSource    qbs = this.query().dataSourceName(PriceDiscTable_DS.name());

    if (qbs.rangeCount())
    {
        qbs.clearRanges();
    }

    this.query().dataSourceName(PriceDiscTable_DS.name()).addRange(fieldNum(PriceDiscTable, Relation)).value(queryValue(PriceType::PricePurch) + ',' + queryValue(PriceType::LineDiscPurch));
    this.query().dataSourceName(PriceDiscTable_DS.name()).addRange(fieldNum(PriceDiscTable, AccountCode)).value(queryValue(PriceDiscPartyCodeType::Table));
    this.query().dataSourceName(PriceDiscTable_DS.name()).addRange(fieldNum(PriceDiscTable, ItemCode)).value(queryValue(PriceDiscProductCodeType::Table));

    QueryBuildRange criteriaPriceDiscItemId = qbs.addRange(fieldNum(PriceDiscTable, ItemRelation));

    criteriaPriceDiscItemId.value(queryValue(itemId));

    this.query().dataSourceName(priceDiscInventDim_ds.name()).clearRanges();

    InventDimGroupSetup::newItemId(itemId).inventDimParmActivePurchPrice(inventDimParmSalesPriceItemDim);

    if (rangeItemDim)
    {
        InventDim::queryDatasourceAddRangeSortFromParms(this.query().dataSourceName(priceDiscInventDim_ds.name()),
                                                false, inventDim, inventDimParmSalesPriceItemDim, inventDimParmGroupBy);
    }

    super();
}

void init()
{
    super();

    this.query().dataSourceName(PriceDiscTable_DS.name()).clearDynalinks();
}

void executeQuery()
{
    InventDimParm           inventDimParmGroupBy;
    QueryBuildDataSource    qbs = this.query().dataSourceName(CustVendExternalItem_DS.name());

    if (qbs.rangeCount())
    {
        qbs.clearRanges();
    }

    qbs.addRange(fieldNum(CustVendExternalItem, ModuleType)).value(enum2Value(ModuleInventPurchSalesVendCustGroup::Vend));

    QueryBuildRange criteriaCustVendItemId = qbs.addRange(fieldNum(CustVendExternalItem, ItemId));
    criteriaCustVendItemId.value(queryValue(itemId));

    this.query().dataSourceName(externalItemInventDim_ds.name()).clearRanges();

    if (rangeItemDim)
    {
        InventDim::queryDatasourceAddRangeSortFromParms(this.query().dataSourceName(externalItemInventDim_ds.name()),
                                                false, inventDim, inventDimParmExternalItemDim, inventDimParmGroupBy);
    }

    super();
}

