public void executeQuery()
{
    Query                   query = this.query();
    QueryBuildDataSource    qbs = query.dataSourceName(PdsApprovedVendorList_DS.name());

    if (qbs.rangeCount())
    {
        qbs.clearRanges();
    }

    query.validTimeStateDateRange(dateNull(), dateMax());

    QueryBuildRange qbr = qbs.addRange(fieldNum(PdsApprovedVendorList, ItemId));
    qbr.value(queryValue(itemId));

    super();
}

public void init()
{
    super();

    this.query().dataSourceName(PdsApprovedVendorList_DS.name()).clearDynalinks();
    pdsApprovedVendorList_ds.cacheAddMethod(tableMethodStr(PdsApprovedVendorList, vendName));
}

public void tabChanged(int _fromTab, int _toTab)
{
    super(_fromTab, _toTab);

    element.setSelectMode();

    if (filterLookup)
    {
        selectedFormDataSource.research();
    }

    SysTableLookup::lookupTabChanged(callerControl,
                                     selectedControl,
                                     selectedFormDataSource);
}
